import React from 'react'

function NavBar() {
    return (
        <div className='nav-bar'>
            <ul>
                <li><button>PlayLists</button></li>
                <li><button>Artists</button></li>
                <li><button>Albums</button></li>
            </ul>
        </div>
    )
}

export default NavBar
